import axios from 'axios';
import { useEffect } from 'react';
import { Post } from './post'
import { Share } from './share'

export function Feed() {
    let Posts = [{ id: "", userId: "string", desc: "", like: [{}], comments: [{}], date: "", photo: "" }];

    let url = 'http://127.0.0.1:5789/post/myChild';

    useEffect(() => {
        axios.get(url,)
            .then(response => {
                console.log(response.data);

                Posts = response.data;
            });
    }, [])

    return (
        <div>
            <Share category='myChild' />
            {Posts.map((curr, i) => (

                <Post key={i} postItems={curr} />

            ))}
        </div>
    )
}
